CREATE TABLE cliente (
    id serial,
	cod_cliente integer,
	nome varchar(100),
	cpf_cnpj varchar(18),
	tipo_pessoa varchar(1),
	data_cad date,
	cep integer,
	bairro varchar(100) NULL
);
CREATE TABLE cidade (
    id serial,
	cod_cidade integer,
	nome varchar(100),
	estado varchar(2) NULL
);
-----------
CREATE TABLE faixas_cep (
    id serial,
	cep_inicio integer,
	cep_fim integer,
	cod_cidade integer,
	estado varchar(2) NULL
);
CREATE UNIQUE INDEX faixascep_codcidade_idx ON faixas_cep(cod_cidade);
CREATE UNIQUE INDEX faixascep_cepinicioefim_idx ON faixas_cep(cep_inicio,cep_fim);
-----------
CREATE TABLE grupo_produto (
    id serial,
	cod_grupo integer,
	descricao varchar(100) NULL
);
-----------
CREATE TABLE colecao_produto (
    id serial,
	cod_colecao integer,
	descricao varchar(50),
	dt_inicio date,
	dt_fim date NULL
);
-----------
CREATE TABLE produto (
    id serial,
	cod_produto integer,
	barra varchar(13),
	descricao varchar(100),
	preco numeric(13,2),
	cod_grupo integer,
	cod_colecao integer,
	data_cad date,
	obs varchar(100)
);
-----------
CREATE TABLE produto_estoque (
	cod_produto integer,
	estoque_atual integer,
	estoque_minimo integer,
	estoque_maximo integer
);
CREATE UNIQUE INDEX produtoestoque_codproduto_idx ON produto_estoque(cod_produto);
----------
CREATE TABLE condicao_pagamento (
    id serial,
	cod_condicao integer,
	descricao varchar(150),
	numero_parcelas integer
);
-----------
CREATE TABLE condicao_pagamento_dias (
    id serial,
	cod_condicao integer,
	numero_parcela integer,
	dias integer
);
CREATE UNIQUE INDEX condpagdias_codcondicaoeparcela_idx ON condicao_pagamento_dias(cod_condicao,numero_parcela);
-----------
CREATE TABLE pedido (
    id serial,
	pedido integer,
	cod_cliente integer,
	data_emissao date,
	cod_condicao integer,
	perc_desconto numeric(13,2),
	valor_total_liquido numeric(13,2),
	valor_total_bruto numeric(13,2),
);
-----------
CREATE TABLE pedido_itens (
    id serial,
	pedido integer,
	cod_produto integer,
	qtde_original integer,
	qtde_pendente integer,
	qtde_faturada integer,
	preco_unitario numeric(13,2),
	ordem integer
);
CREATE UNIQUE INDEX pedidoitens_pedidoecodproduto_idx ON pedido_itens(pedido,cod_produto);
-----------
CREATE TABLE calendario (
    id serial,
	data_ano date,
	dia_util varchar(1),
	dia_semana varchar(7)
);
CREATE UNIQUE INDEX calendario_datano_idx ON calendario(data_ano);
-----------
CREATE TABLE movimento_historico (
    id serial,
	data_movimento date,
	cod_produto integer,
	qtde_movimento integer,
	tipo_movimentacao varchar(10)
);
-----------
--- ESSA VIEW FUNCIONARÁ ATÉ O ANO DE 2028, POIS OS REGISTROS DA TABELA CALENDARIO COMEÇAM EM 2024 E TERMINAM EM 2028
--- ENTÃO, QUANDO O ANO ATUAL FOR 2029, O "WHERE" ANO DA DATA ATUAL = ANO DA TABELA CALENDARIO, FARÁ COM QUE NÃO RETORNE NADA.
--- SOLUÇÕES: ADICIONAR MAIS REGISTROS NA TABELA CALENDÁRIO, OU ALTERAR O "WHERE" PARA ALGUMA OUTRA CONDIÇÃO.
CREATE VIEW ANO_MESES AS 
SELECT EXTRACT(MONTH FROM DATA_ANO) MES, MIN(DATA_ANO) INICIO_MES, MAX(DATA_ANO) FIM_MES FROM CALENDARIO 
WHERE EXTRACT(YEAR FROM CURRENT_DATE)=2024
GROUP BY EXTRACT(MONTH FROM DATA_ANO);
----------
CREATE VIEW UM_ATE_MIL AS 
SELECT ROW_NUMBER() OVER (PARTITION BY 1) SEQUENCIAL FROM calendario LIMIT 1000;
